y=df['Category']
X=df['Message']

#Then, you need to clean the data so that it doesn't have any special characters, digits, multiple empty spaces, etc. that might interfere when using the algorithm
def clean_text(doc):
  document=re.sub('[^a-zA-Z]',' ',doc)
  document=re.sub('\s',' ',doc)
  document=re.sub('\s+[a-zA-Z]\s+',' ',doc)
  return document

#Create a list that will store the cleaned sentences
X_sentences=[]
reviews=list(X)
for each in reviews:
  X_sentences.append(clean_text(each))

#Given Naive Bayes algorithm is a statistical algorithm, the test of emails need to be converted to numeric forms
#Ways include: Bag of Words, TFIDF, Word Embeddings
#In this case, the technique used will be TfIdfVectorizer class from sklearn.feature_extraction.text
#Need to first fit() and then transform() (methods used)

# Initialize the TfidfVectorizer with specific parameters
vectorizer = TfidfVectorizer(max_features=2500, min_df=5, max_df=0.7, stop_words=stopwords.words('english'))

"""

```
1. from nltk.corpus import stopwords
2. from sklearn.feature_extraction.text import TfidfVectorizer
3.
4. vectorizer = TfidfVectorizer (max_features=2500, min_df=5, max_df=0.7,
stop_words=stopwords.words(‘english’ ))
5. X= vectorizer.fit_transform(X_sentences).toarray
```

In the above script, the max_features attribute specifies that a maximum of 2500 most occurring words should be used to create a feature dictionary. The min_df attribute here specifies to only include words that occur for a minimum of five times across all documents. Max_df defines not to include words that occur in more than 70 percent of the documents.
"""

#Similar to Linear Regression model, time to train the model by using the train_test_split
# First split the data into training and test sets
X_train, X_test, y_train, y_test = train_test_split(X_sentences, y, test_size=0.25, random_state=42)

# Fit and transform the training data into numeric form
X_train_transformed = vectorizer.fit_transform(X_train).toarray()

# Transform the test data (without refitting the vectorizer)
X_test_transformed = vectorizer.transform(X_test).toarray()

# Initialize the Naive Bayes model
spam_detector = MultinomialNB()

# Train the model using the transformed training data
spam_detector.fit(X_train_transformed, y_train)

y_pred=spam_detector.predict(X_test_transformed)

from sklearn.metrics import classification_report, confusion_matrix, accuracy_score
print(confusion_matrix(y_test,y_pred))
print(classification_report(y_test,y_pred))
print(accuracy_score(y_test,y_pred))

